void turning(EPuck::Robot& robo, float _diff)
{
    float wheels_diff = _diff;
    Wheels_t wheels = robo.wheels();
    if (wheels_diff > 45)
    {
        wheels.Left = -100;
        wheels.Right = 100;
        robo.setWheels(wheels);
    }
    else if (((wheels_diff <= 45) && (wheels_diff > 10)))
    {
        wheels.Left = -50;
        wheels.Right = 50;
        robo.setWheels(wheels);
    }
    else if ((wheels_diff <= 10) && (wheels_diff > 2))
    {
        wheels.Left = -10;
        wheels.Right = 10;
        robo.setWheels(wheels);
    }
    else if ((wheels_diff <= 2) && (wheels_diff > 0.2))
    {
        wheels.Left = -5;
        wheels.Right = 5;
        robo.setWheels(wheels);
    }
    else if ((wheels_diff <= 0.2) && (wheels_diff > 0))
    {
        wheels.Left = -1;
        wheels.Right = 1;
        robo.setWheels(wheels);
    }

    if (wheels_diff < -45)
    {
        wheels.Left = 100;
        wheels.Right = -100;
        robo.setWheels(wheels);
    }
    else if ((wheels_diff >= -45) && (wheels_diff < -10))
    {
        wheels.Left = 50;
        wheels.Right = -50;
        robo.setWheels(wheels);
    }
    else if ((wheels_diff >= -10) && (wheels_diff < -2))
    {
        wheels.Left = 10;
        wheels.Right = -10;
        robo.setWheels(wheels);
    }
    else if ((wheels_diff >= -2) && (wheels_diff < -0.2))
    {
        wheels.Left = 5;
        wheels.Right = -5;
        robo.setWheels(wheels);
    }
    else if ((wheels_diff >= -0.2) && (wheels_diff < 0))
    {
        wheels.Left = 1;
        wheels.Right = -1;
        robo.setWheels(wheels);
    }
}

